export const UserActionTypes = {
    /**
     * LOGIN ACTION TYPES
     */
    LOGIN_START: "LOGIN_START",
    LOGIN_SUCCESS: "LOGIN_SUCCESS",
    LOGIN_ERROR: "LOGIN_ERROR",

    /**
     * SIGNUP ACTION TYPES
     */
    SIGN_UP_START: "SIGN_UP_START",
    SIGN_UP_SUCCESS: "SIGN_UP_SUCCESS",
    SIGN_UP_ERROR: "SIGN_UP_ERROR",

    /**
     * LOGOUT ACTION TYPES
     */
    LOG_OUT: "LOG_OUT",
  };
